import React from "react";
import { Navbar, Nav, NavLink } from "reactstrap";

const NavBar = () => {
  return (
    <div>
      <Navbar>
        <Nav className="justify-content-end">
          <NavLink href="#">Logout</NavLink>
        </Nav>
      </Navbar>
    </div>
  );
};

export default NavBar;
